<!DOCTYPE html>
<html xmlns="http://www.w3.org/1999/xhtml" xmlns="http://www.w3.org/1999/html"
      xmlns="http://www.w3.org/1999/html">
<head>
    <meta content="en-us" http-equiv="Content-Language" />
    <meta content="text/html; charset=utf-8" http-equiv="Content-Type" />
    <meta name="viewport" content="width=device-width, initial-scale=1.0, maximum-scale=1.0, user-scalable=no">
    <title>${TITLE}</title>
</head>
<style>

body{
	background:#ffffff;text-align:center;margin:0px;
}

.leftalign{
	text-align:left;
	margin-right: 20px;
	margin-left: 20px;
}

html{
	font-family: serif;
	font-size: 11pt;
}

h2{
	color: orangered;
	margin-bottom: 0;
	font-size: 11pt;
}

a:link{
	color: orangered;
}

h3{
	margin-top: 0;
	margin-bottom: 0;
	font-size: 10pt;
}
p{
	margin: 0;
}
output h1 {
	background-color: orangered;
	text-align:center;
	color:white;
	font-size: 18pt;
}


#search_input{
	height:35px;
	width:100%;
	outline:none;
	border:none;
	font-size: 13px;
	background-color:transparent;
}

div.favicon_all{margin:0 5%}
div.favicon_img{width:18%;margin:2%;float:left}
div.favicon_img img {width:50px;height:50px}
div.favicon_name{padding:2%;text-align:center;font-size:80%}

span {
	display: block;
	overflow: hidden;
	padding-left:5px;
	vertical-align:middle;
}

.search_bar{
	display:table;
	vertical-align:middle;
	width:90%;
	height: 37px;
	max-width:500px;
	margin:0 auto;
	background-color: transparent;
	font-family: Arial;
	color: #0d000000;
	border: 2px solid #E0E0E0;
     border-radius: 10px;
    padding: 5px;
}

#search_submit{
	outline:none;
	height:37px;
	float:right;
	color:#404040;
	font-size:16px;
	font-weight:bold;
	border:none;
	background-color:transparent;
}

.outer {
	display: table;
	position: absolute;
	height: 100%;
	width: 100%;
}

.middle {
	display: table-cell;
}

.inner {
	margin-left: auto;
	margin-right: auto;
	margin-bottom:10%;
	width: 100%;
}

img.smaller{width:36%;max-width:200px;}

.box {
	vertical-align:middle;
	position:relative;
	display: block;
	margin: 10px;
	padding-left:10px;
	padding-right:10px;
	padding-top:5px;
	padding-bottom:5px;
	background-color:#fff;
	box-shadow: 0px 3px rgba( 0, 0, 0, 0.1 );
	font-family: Arial;
	color: #444;
	font-size: 12px;
	-moz-border-radius: 10px;
	-webkit-border-radius: 10px;
	border-radius: 10px;
}
</style>

<br>
</br></br></br></br></br></br></br></br>
<div class="outer">
    <div class="middle"><div class="inner">
        <img id="image_url" class="smaller" src="${IMAGE}">
        </br></br></br>
        <form onsubmit="return search()" class="search_bar" autocomplete="off">
            <input type="submit" id="search_submit" value="" >
            <span>
		<input class="search" type="text" placeholder="Type search " value="" id="search_input" >
	</span>
        </form>

        </br></br>
